import { Bank } from '../bank';
import { BANKS } from '../banks';


@Component({
  selector: 'app-banks',
  templateUrl: './banks.component.html',
  styleUrls: ['./banks.component.css']
})

export class BanksComponent implements OnInit {
  banks = BANKS;
  selectedBank: Bank;

  constructor() { }

  onSelect(bank: Bank): void {
    this.selectedBank = bank;
  }

  ngOnInit():  void{
  }
}
